import React from "react";

function About() {
  return (
    <div className={`about`}>
      <div className={`container vh-100`}>
        <div className={`about_content`}>
          <h2></h2>
        </div>
        <div className="about_icon">
          <i></i>
        </div>
        <div className="about_para">
          <div className="row">
            <div className="col-6"></div>
          </div>
        </div>
      </div>
    </div>
  );
}

export default About;
